import React from "react";
import { BrowserRouter , Routes, Route } from 'react-router-dom';

import MasterLayout from "./layout/admin/MasterLayout";

 function App() {
  return (
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<MasterLayout />}>
          </Route>
        </Routes>
      </BrowserRouter>
  );
}

export default App;
